import React from "react";
import "./reading.js";
import "./chart.js";
import "./frontpage.js";
import Content from "./content";
import Sidebar from "./sidebar";
import "./index.css";
import "./basscss.css";

function App() {
  return (
    <div className="background shadow-2 flex overflow-hidden">
      <Sidebar />
      <Content />
      <Modal />
    </div>
  );
}

export default App;
